<!DOCTYPE html>
<html lang="es">
<head>
    <style>
        * {
            font-family: 'Montserrat', sans-serif;
            box-sizing: border-box;
        }

        body {
            background: url(images/fondologin.jpg);
            background-repeat: no-repeat;
        }
        .img_login {
            width: 60%;
            height: auto;
            display: block;
            margin-left: auto;
            margin-right: auto
        }

        .login {
            background: #ffffff;
            height: 580px;
            padding: 80px 40px;
            border-radius: 10px;
            position: absolute;
            left: 50%;
            top: 50%;
            transform: translate(-50%,-50%);
        }

        .lgn {
            border-bottom: 2px solid #adadad;
            position: relative;
            margin: 30px 0;
        }

            .lgn input {
                font-size: 15px;
                color: #333;
                border: none;
                width: 100%;
                outline: none;
                background: none;
                padding: 0 5px;
                height: 40px;
            }

            .lgn span::before {
                content: attr(data-placeholder);
                position: absolute;
                top: 50%;
                left: 5px;
                color: #adadad;
                transform: translateY(-50%);
                z-index: -1;
                transition: .5s;
            }

            /*
            .lgn span::after {
                content: '';
                position: absolute;
                width: 0%;
                height: 2px;
                background: linear-gradient(120deg,#3498db,#8e44ad);
                transition: .5s;
            }
            */

        .focus + span::before {
            top: -5px;
        }

        .focus + span::after {
            width: 100%;
        }

        .logbtn {
            display: block;
            width: 100%;
            height: 50px;
            border: none;
            background: linear-gradient(120deg,#3498db,#8e44ad,#3498db);
            background-size: 200%;
            color: #fff;
            outline: none;
            cursor: pointer;
            transition: .5s;
            font-weight: bold;
            }

        .logbtn:hover {
                background-position: right;
        }

        .bottom-text {
            margin-top: 100px;
            text-align: center;
            font-size: 13px;
            color: white;
            font-weight: bold;
        }


    </style>


    <meta http-equiv=”Content-Type” content=”text/html; charset=UTF-8″ />
    <title>Middle Earth - Inicio de Sesión</title>
    <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.7.1/css/all.css">
    <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@300;600&display=swap" rel="stylesheet">
    <link rel="shortcut icon" href="images/icono.png" type="image/x-icon">
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.4.1/jquery.min.js" charset="utf-8"></script>
    <script type="text/javascript" src="js/validacion_login.js"></script>
</head>


<body>


    <form action="autenticar_usuario.php" class="login" method="post">
        <img class="img_login" src="data:image/png;base64,"></a>

        <div class="lgn">
            <input id="email" type="text" name="email" oninput="validacion_email();" required>
            <span data-placeholder="&#x2709; Correo electrónico"></span>
        </div>

        <div class="lgn">
            <input id="contrasena" type="password" name="password" oninput="validacion_contrasena();" required>
            <span data-placeholder="&#x26A0; Contraseña"></span>
        </div>

        <input type="submit" class="logbtn" value="Entrar">

        <div class="bottom-text">
            ¿No tienes cuenta? 
            <a href="form_alta_usuario.php">Regístrate.</a>
        </div>

    </form>

    <script type="text/javascript">
        $(".lgn input").on("focus", function () {
            $(this).addClass("focus");
        });

        $(".lgn input").on("blur", function () {
            if ($(this).val() == "")
                $(this).removeClass("focus");
        });

    </script>

</body>
</html>